import React from "react";
import './email.styles.css';

const EmailCard = ({ email, onClick, isActive }) => {
  const { from, address, time, subject, read } = email;

  return (
    <div
      className={`card-container ${read ? 'read' : 'unread'} ${isActive ? 'active' : ''}`}
      onClick={onClick}
    >
      <h2>{from}</h2>
      <p>{address}</p>
      <p>{time}</p>
      <p>{subject}</p>
    </div>
  );
};

export default EmailCard;
